import React, { useState, useEffect, useRef } from "react";
import "./TopbarWithCitySelector.css"; // IMPORTANT: include CSS

export default function Topbar() {
  const [isOpen, setIsOpen] = useState(false);
  const [selectedCity, setSelectedCity] = useState(
    localStorage.getItem("selectedCity") || "Lucknow"
  );
  const [query, setQuery] = useState("");
  const modalRef = useRef(null);

  const popularCities = [
    "Delhi NCR",
    "Bangalore",
    "Hyderabad",
    "Mumbai",
    "Pune",
    "Delhi",
    "Gurgaon",
    "Noida",
    "Ahmedabad",
    "Chennai",
    "Kolkata",
    "Lucknow",
    "Jaipur",
    "Chandigarh",
  ];

  const moreCities = [
    "Ambala",
    "Coimbatore",
    "Faridabad",
    "Ghaziabad",
    "Kanpur",
    "Karnal",
    "Kochi",
    "Mysuru",
    "Sonipat",
    "Visakhapatnam",
  ];

  const allCities = [...new Set([...popularCities, ...moreCities])];

  useEffect(() => {
    function handleKey(e) {
      if (e.key === "Escape") setIsOpen(false);
    }
    document.addEventListener("keydown", handleKey);
    return () => document.removeEventListener("keydown", handleKey);
  }, []);

  useEffect(() => {
    function handleClickOutside(e) {
      if (isOpen && modalRef.current && !modalRef.current.contains(e.target)) {
        setIsOpen(false);
      }
    }
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, [isOpen]);

  const handleSelectCity = (city) => {
    setSelectedCity(city);
    localStorage.setItem("selectedCity", city);
    setIsOpen(false);
    setQuery("");
  };

  const filteredCities = allCities.filter((city) =>
    city.toLowerCase().includes(query.toLowerCase())
  );

  return (
    <>
      <header className="topbar">
        <div className="topbar-left">
          <div className="logo">
            <img className="logo-img" src="/carsdedo.jpeg" alt="Company Logo" />
          </div>

          {/* üî• REPLACED THE OLD LOCATION DROPDOWN */}
          <div
            className="location-btn"
            onClick={() => setIsOpen(true)}
            role="button"
          >
            {selectedCity} ‚ñæ
          </div>
        </div>

        <div className="topbar-center">
          <input
            className="top-search"
            placeholder="Search by assured plus cars"
          />
        </div>

        <div className="topbar-right">
          <nav className="top-actions">
            {/* BUY CAR */}
            <div className="dropdown">
              <div className="action">Buy Car ‚ñæ</div>
              <div className="dropdown-menu">
                <div className="dropdown-item">Used Cars</div>
                <div className="dropdown-item">Certified Cars</div>
                <div className="dropdown-item">Cars Under ‚Çπ5 Lakh</div>
                <div className="dropdown-item">New Arrivals</div>
                <div className="dropdown-item">View All</div>
              </div>
            </div>

            {/* SELL CAR */}
            <div className="dropdown">
              <div className="action">Sell Car ‚ñæ</div>
              <div className="dropdown-menu">
                <div className="dropdown-item">Instant Online Quote</div>
                <div className="dropdown-item">Car Inspection Booking</div>
                <div className="dropdown-item">Exchange My Car</div>
                <div className="dropdown-item">Get Best Price</div>
              </div>
            </div>

            {/* SERVICE */}
            <div className="dropdown">
              <div className="action">Service ‚ñæ</div>
              <div className="dropdown-menu">
                <div className="dropdown-item">Periodic Maintenance</div>
                <div className="dropdown-item">Car Wash & Detailing</div>
                <div className="dropdown-item">Tyre Replacement</div>
                <div className="dropdown-item">Insurance Renewal</div>
                <div className="dropdown-item">Roadside Assistance</div>
              </div>
            </div>
          </nav>

          <div className="call">
            Call us: <strong>9664573074</strong>
          </div>
        </div>
      </header>

      {/* --------------------------------------- */}
      {/*          CITY SELECTOR MODAL           */}
      {/* --------------------------------------- */}

      {isOpen && (
        <div className="modal-overlay">
          <div className="modal" ref={modalRef}>
            <div className="modal-header">
              <div>
                <h3 className="modal-title">Select a city</h3>
                <div className="modal-subtitle">Popular cities & more</div>
              </div>

              <button
                className="modal-close"
                onClick={() => setIsOpen(false)}
              >
                √ó
              </button>
            </div>

            {/* Search box */}
            <div className="search-box">
              <svg className="search-icon" width="16" height="16">
                <path d="M12.9 14.32a8 8 0 111.414-1.414l4.3 4.3a1 1 0 01-1.414 1.414l-4.3-4.3zM8 14a6 6 0 100-12 6 6 0 000 12z" />
              </svg>
              <input
                className="search-input"
                placeholder="Search for a city"
                value={query}
                onChange={(e) => setQuery(e.target.value)}
              />
            </div>

            {/* Popular Cities */}
            <div className="popular-section">
              <div className="section-title">POPULAR CITIES</div>

              <div className="popular-grid">
                {popularCities.map((city) => (
                  <button
                    key={city}
                    className={`city-card ${
                      selectedCity === city ? "selected" : ""
                    }`}
                    onClick={() => handleSelectCity(city)}
                  >
                    <div className="city-icon">üèô</div>
                    <div className="city-name">{city}</div>
                  </button>
                ))}
              </div>
            </div>

            {/* More cities */}
            <div className="more-section">
              <div className="section-title">MORE CITIES</div>
              <div className="pills">
                {moreCities.map((city) => (
                  <button
                    key={city}
                    className={`pill ${
                      selectedCity === city ? "pill-selected" : ""
                    }`}
                    onClick={() => handleSelectCity(city)}
                  >
                    {city}
                  </button>
                ))}
              </div>
            </div>

            {/* Search results */}
            {query && (
              <div className="search-results">
                <div className="results-title">Search results</div>
                <div className="results-list">
                  {filteredCities.length > 0 ? (
                    filteredCities.map((city) => (
                      <div
                        key={city}
                        className="result-item"
                        onClick={() => handleSelectCity(city)}
                      >
                        {city}
                      </div>
                    ))
                  ) : (
                    <div className="no-results">No cities found</div>
                  )}
                </div>
              </div>
            )}
          </div>
        </div>
      )}
    </>
  );
}
